import { Rate } from "./Rate";
import style from "./DetailsProp.module.scss";

const DetailsProps = ({ isRate, label, value }) => {
    return (
        <div className={style.detail_prop}>
            <span>{label}</span>
            {isRate ? <Rate rate={value} /> : <span>{value}</span>}
        </div>
    );
};

export default DetailsProps;
